import React from 'react'
import "../Sidebar/Sidebar.css"
import sidemenu from "../../Data/ItemData"

function Sidebar() {
  return (
    <div>
      <ul></ul>
        {
            sidemenu.map((item)=>{
                return(
                    <div key={item.id}>
                      <span className=''>{item.name}</span>
                      </div>
                )
            })
        }
    </div>
  )
}

export default Sidebar
